class Solution:
    def hasGroupsSizeX(self, deck: List[int]) -> bool:
        

        countTracker = {}
        distinctValues = []

        countTracker = dict.fromkeys(deck,0)
       # print(countTracker)

        if len(deck)==1:
            return False

        for i in deck:
            countTracker[i] =  countTracker[i]  + 1

        #print(countTracker)

        for j in countTracker.values():
            if j not in distinctValues:
                distinctValues.append(j)

#        print (distinctValues)
        distinctValues.sort()

        if len(distinctValues)==1:
            return True

        elif distinctValues[0]%2 == 0 and distinctValues[1]%2 == 0:
            for i in distinctValues:
                if i%2!=0:
                    return False
            return True
        
        elif distinctValues[len(distinctValues)-1]%3 == 0 and distinctValues[0]%3 == 0:
            return True

        elif distinctValues[len(distinctValues)-1]%5 == 0 and distinctValues[0]%5 == 0:
            return True

        else:# len(distinctValues)==1:
            return False



